import React from 'react'

function MiComponente({rey}) {
  return (
    <div>
        <h1>Hola {rey} come {reses} vacas al dia</h1>
    </div>
  )
}
MiComponente.defaultProps = {
    reses:"pocas",
    rey:"Rey Godo",
}
export default MiComponente
